import { useState, useMemo, forwardRef } from "react";
import axios from "axios";
import LoginPage from "./LoginPage";
import SignupPage from "./SignupPage";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import style from "../style/Results.module.css";

const API_URL = process.env.REACT_APP_API_URL || "http://localhost:3000";

function Results({
  token,
  onAuthSuccess,
  onLoginClick,
  onCloseModal,
  activeView,
  onEditClick,
  movimientos,
  onMovementUpdate,
  onShowAllChange,
}) {
  const [selectedDate, setSelectedDate] = useState(new Date());
  const [showAll, setShowAll] = useState(false);

  /* ---------------- FILTRO ---------------- */
  const filteredMovimientos = useMemo(() => {
    if (!Array.isArray(movimientos)) return [];

    if (showAll) return movimientos;

    const localDate = new Date(selectedDate);
    localDate.setMinutes(
      localDate.getMinutes() - localDate.getTimezoneOffset()
    );

    const formatted = localDate.toISOString().slice(0, 10);

    return movimientos.filter(
      (mov) => mov.fecha.slice(0, 10) === formatted
    );
  }, [movimientos, selectedDate, showAll]);

  /* ---------------- ACTIONS ---------------- */
  const handleDeleteMovimiento = async (id) => {
    if (!window.confirm("¿Eliminar movimiento?")) return;

    try {
      await axios.delete(`${API_URL}/api/add/${id}`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      onMovementUpdate && onMovementUpdate();
    } catch {
      alert("Error al eliminar");
    }
  };

  const handleAllMovimientos = async () => {
    try {
      const res = await axios.get(`${API_URL}/api/add/all`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      onMovementUpdate(res.data);
      setShowAll(true);
      onShowAllChange && onShowAllChange(true);
    } catch {
      alert("Error al cargar historial");
    }
  };

  const handleDateChange = (date) => {
    setSelectedDate(date);
    setShowAll(false);
    onShowAllChange && onShowAllChange(false);
  };

  const CalendarButton = forwardRef(({ onClick }, ref) => (
    <button className={style.calendarButton} onClick={onClick} ref={ref}>
      <img src="/calendario.png" alt="calendario" />
    </button>
  ));

  if (!token) {
    return activeView === "login" ? (
      <LoginPage onClose={onCloseModal} onAuthSuccess={onAuthSuccess} />
    ) : (
      <SignupPage onSwitchToLogin={onLoginClick} onAuthSuccess={onAuthSuccess} />
    );
  }

  /* ---------------- UI ---------------- */
  return (
    <div className={style.container}>
      <div className={style.header}>
        <DatePicker
          selected={selectedDate}
          onChange={handleDateChange}
          customInput={<CalendarButton />}
        />

        <button onClick={handleAllMovimientos} className={style.icon}>
          Historial
        </button>
      </div>

      <div className={style.movimientosList}>
        {(showAll ? movimientos : filteredMovimientos).map((mov) => (
          <div
            key={mov._id}
            className={`${style.movimientoRow} ${
              mov.tipo === "ingreso"
                ? style.bordeIngreso
                : style.bordeEgreso
            }`}
          >
            {/* COLUMNA 1 */}
            <div className={style.colInfo}>
              <p className={style.fecha}>
                {new Date(mov.fecha).toLocaleDateString()}
              </p>
              <p className={style.categoria}>{mov.categoria}</p>
              <p className={style.detalle}>{mov.detalle}</p>
            </div>

            {/* COLUMNA 2 */}
            <div className={style.colMonto}>
              {mov.tipo === "ingreso" ? "+" : "-"} ${mov.monto}
            </div>

            {/* COLUMNA 3 */}
            <div className={style.colActions}>
              <button onClick={() => onEditClick(mov)}>
                <img src="/edit.png" alt="edit" />
              </button>
              <button onClick={() => handleDeleteMovimiento(mov._id)}>
                <img src="/trush.png" alt="delete" />
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Results;
